import React from 'react'
import "./Users.css"
import { DataGrid } from '@mui/x-data-grid';



export default function User() {
  const columns = [
    { field: 'id', headerName: 'ID', width: 70 },
    { field: 'gerecht', headerName: 'Gerecht', width: 130 },
    {
      field: 'Vegan',
      headerName: 'Vegan',
      type: 'boolean',
      width: 100,
    },
    {
      field: 'Halal',
      headerName: 'Halal',
      type: 'boolean',
      sortable: false,
      width: 100,
    },
  ];

  const rows = [
    { id: 1, gerecht: 'Snow', age: 50, vegan: yes},
    { id: 2, gerecht: 'Cersei', age: 42 },
    { id: 3, gerecht: 'Lannister', age: 45 },
    { id: 4, gerecht: 'Stark', age: 16 },
  ];

  return (
    <div className="UserList">
      <DataGrid
        rows={rows}
        columns={columns}
        pageSize={5}
        rowsPerPageOptions={[5]}
        checkboxSelection
      />
    </div>
  )
}
